Contrasting Two Labour MPs. On the left Diana Johnson receiving the award as best back bench MP 2018 from Jon Snow for successfully campaigning for the victims of the NHS contaminated blood scandal, and successfully launching the new Abortion Bill in November 2018. On the right, our own Wythenshawe MP, Shadow Schools  minister, Mr Mike Kane, who voted with the DUP and 108 Tories against the new Abortion Bill which would extend the same abortion rights to women in Northern Ireland that women in the rest of the UK, and indeed the majority Catholic Irish Republic, enjoy. This is the Bill Mr Kane and the DUP voted against, and that the majority of MPs, including even a majority of Tories, voted to support:- 
‚Ä¢ to remove criminal liability in respect of abortion performed with the consent of the pregnant woman up to the twenty-fourth week of pregnancy;
‚Ä¢ to repeal sections 59 and 60 of the Offences Against the Person Act 1861.
‚Ä¢ to create offences of termination of a pregnancy after its twenty-fourth week and non-consensual termination of a pregnancy;
‚Ä¢ to amend the law relating to conscientious objection to participation in abortion treatment;
‚Ä¢ and for connected purposes.
‚Ä¢ The proposed bill would apply to Northern Ireland where at the moment the Infant Life (Preservation) Act 1929 only permitted abortion to preserve the life of the mother and many women cross the border to the Republic or cross over to England to seek an abortion.
This Page supports reproductive freedom as a basic human right and supports the right of women to equal access to reliable, quality healthcare under our present abortion law and welcomes the new law in prospect which will extend the same right to women in Northern Ireland.
One interesting footnote which could be construed as self serving. Ms. Johnson voted to reduce the number of 650 MPs ‚Äì Mr.Kane voted not to reduce the number. There are only 435 Congressmen in the House of Representatives in the US and only 100 in the Senate whilst we have 850 members in House of Lords.

